import axios from "axios";
import { useState, useEffect } from "react";

const ListPage = () => {

    const [posts,setPosts] = useState([]);

    const getPosts = () => {
        axios.get('http://localhost:3001/posts').then((res)=>{
            setPosts(res.data);
        })
    }

    useEffect(()=>{
        getPosts();
    },[]);


    return (
        <div>
            <h1>Blogs</h1>
            {posts.map(post=>{
                return(
                    <div>{post.title}</div>
                )
            })}
        </div>
    );
};

export default ListPage;
